import React from "react";
import "./Generate.css";

const Generate = () => {
  return (
    <div className="Generate">
      <div className="left-g">
        <hr />
        <div>
          <span className="stroke-text">Generate Your</span>
          <span>Loved</span>
        </div>
        <div>
          <span>Ones In The Form Of</span>
          <span className="stroke-text">Avatars</span>
        </div>
      </div>
      <div className="right-g">
        <form action="" className="generate">
          <input type="file" name="image" placeholder="Upload Your Image" />
          <button className="btn btn-g">Upload</button>
        </form>
      </div>
    </div>
  );
};

export default Generate;
